const BlogList = (prop) => {

   const blogs = prop.blogs;
   const title = prop.title;
    return (       
        <div className='para1'>
            <h2>{ title}</h2>
                {blogs.map((blog) => (
                    <div className='blog-preview' key={blog.id}>
                        <h2>{ blog.title }</h2>
                        <p>{ blog.body }</p>
                    </div>
                ))}
        </div>

     );
}

export default BlogList;
